import { Card } from 'antd'
import React from 'react'
import { useSelector } from 'react-redux';

function SearchList({index,list,setStrokeWeight}) {

    const {searchMap}=useSelector((state)=>state.map)

    const strokeWeights= Array.from({length: searchMap.length}, () => 4);

    function mouseOver(index){
        strokeWeights[index]=10
        setStrokeWeight(strokeWeights)
    }

    function mouseOut(index){
        strokeWeights[index]=5
        setStrokeWeight(strokeWeights)

    }

  return (
    <>

    <Card
    style={{borderRadius:20,marginTop:10}}
    >
        <button onMouseOver={()=>mouseOver(index)} onMouseOut={()=>mouseOut(index)} >{list.name}</button>

        {/* <Card.Meta

        description={list.name}
        >

        </Card.Meta> */}

    </Card>
    </>
  )
}

export default SearchList
